import React, { useState, useEffect } from "react";
import styled from "styled-components";

const MainContainer = styled.div`
  width: 100vw;
  height: 100vh;
  overflow-y: scroll;
`;

const Album = styled.ul`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100vw;
  height: calc(300vh - 24rem);
`;

const Photo = styled.li`
  display: flex;
  justify-content: center;
  align-items: center;
  list-style: none;
  width: 100vw;
  height: 200vh;
  overflow: hidden;
  object-fit: contain;
`;

const IMG = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  background-color: aqua;
  border: 5px solid red;
`;

function MainIMGs() {
  return (
    <MainContainer>
      <Album>
        <Photo>
          <IMG>사진1</IMG>
        </Photo>
        <Photo>
          <IMG>사진2</IMG>
        </Photo>
        <Photo>
          <IMG>사진3</IMG>
        </Photo>
        <Photo>
          <IMG>사진4</IMG>
        </Photo>
      </Album>
    </MainContainer>
  );
}

export default MainIMGs;
